import "../App.css";
import React, { useState } from "react";
import Axios from "axios";
import { Container, Table } from "react-bootstrap";

const MissionTools = () => {
  Axios.get("/tooldetails").then((response) => {
    setToolList(response.data);
  });

  const [toolList, setToolList] = useState([]);

  return (
    <div>
      <Container>
        <div style={{ textAlign: "center" }}>
          <b>Tool Catalog</b>
        </div>
        <Table  bordered hover size="sm">
          <thead>
              <tr>Add Tools to Mission</tr>
            <tr>              
              <th>Tool Id</th>
              <th>Name</th>
              <th>Category</th>
              <th>Description</th>
              <th>Image</th>
              <th>Last Updated</th>
              <th>Add Tool</th>
            </tr>
          </thead>
          <tbody>
            {toolList.map((data, index) => (
              <tr key={data.tool_id}>
                <td>{data.tool_id}</td>
                <td>{data.tool_name}</td>
                <td>{data.tool_category}</td>
                <td style={{fontSize: ".75em"}}>{data.tool_description}</td>
                <td><img src={data.tool_img} style={{maxWidth: "100px"}}></img></td>
                <td>{data.last_updated}</td>
                <td><input
                type="checkbox"
                fontSize="10px"
                ></input></td>
            
              </tr>
            ))}
          </tbody>
        </Table>
      </Container>
    </div>
  );
};

export default MissionTools;
